          .borderRadius('20vp')
          .fontSize('16vp')
          .margin({ top: '12vp' })
          .fontWeight(CommonConstants.LOGIN_TEXT_FONT_WEIGHT)
          .fontColor((this.input_userName, this.input_password) ? Color.White : '#66ffffff')
